import { StyleSheet, Text, View ,Button,TextInput ,TouchableOpacity,Image,ImageBackground} from 'react-native'
import React,{ useState } from 'react'

const BookmarkScreen = ({navigation}) => {
  const check =  ""
  
  
//  if(check === 'hello'){
//   check1 = 'hello'
//  }

  if(check === 'hello'){
  return (
    <View>
      <Button
                title='             Rollover             '
                color={'#B5E67C'}
                fontSize={20}
                style={styles.buttonstyle}
                onPress={() => {
                  navigation.navigate('rollover')   
                }}
                />
    </View>
  )}else{

     return (
      <View>
        <Text>BookmarkScreennnn</Text>
        <Text>BookmarkScreen</Text>
        <Button
                title='             select Skill             '
                color={'#B5E67C'}
                fontSize={20}
                style={styles.buttonstyle}
                onPress={() => {
                  //navigation.navigate('skill')   
                  check = 'hello'
                }}
                />
                
      </View>
    )
  }
   
  
}

export default BookmarkScreen

const styles = StyleSheet.create({})
